(async function () {
    try {        
        console.log("================================================");
        const [modules, repoData] = await getAll();
        await checkConnection();

        switch (process.argv[2]) {
            case "--update":
            case "-u":
                try {
                    console.log("================================================");
                    logger("Đang lấy dữ liệu cần thiết..", 'MeewMeew');
                    const update = await checkVersion(modules, data);
                    logger("Lấy dữ liệu thành công !", "MeewMeew");
                    console.log("================================================");
                    if (Object.keys(update.commands).length == 0 && Object.keys(update.events).length == 0) {
                        logger("Bạn hiện đang sử dụng tất cả module ở phiên bản mới nhất !", 'MeewMeew');
                        return console.log("================================================");
                    }
                    logger("Tiến hành cập nhật các module:", 'MeewMeew');
                    await details(update);
                    console.log("================================================");
                    logger("Bắt đầu cập nhật các module của Mew..", "MeewMeew");
                    await loadUpdate(update, repoData);
                    console.log("================================================");
                    logger("Cập nhật hoàn tất !", "MeewMeew");
                    logger("Chúc các bạn sử dụng zui zẻ !", "MeewMeew");
                    console.log("================================================");                    
                }
                catch (e) {
                    console.log(e)
                    logger("Đã có lỗi xảy ra trong quá trình install module", 'error');
                }                
                break;
            case "--install":
            case "-i":
                try {
                    console.log("================================================");
                    logger("Đang lấy dữ liệu cần thiết..", 'MeewMeew');
                    const data = await getModules();
                    logger("Lấy dữ liệu thành công !", "MeewMeew");
                    console.log("================================================");
                    logger("Bắt đầu xóa bỏ cache..", "MeewMeew");
                    await uninstall(data);
                    logger("Dọn dẹp thành công !", "MeewMeew");
                    console.log("================================================");
                    logger("Bắt đầu cài đặt các module của Mew..", "MeewMeew");
                    await loadModule(modules, repoData);
                    console.log("================================================");
                    logger("Cài đặt hoàn tất !", "MeewMeew");
                    logger("Chúc các bạn sử dụng zui zẻ !", "MeewMeew");
                    console.log("================================================");
                }
                catch (e) {
                    console.log(e)
                    logger("Đã có lỗi xảy ra trong quá trình install module", 'error');
                }
                break;
            case "--uninstall":
            case "-un":
                try {
                    console.log("================================================");
                    logger("Đang lấy dữ liệu cần thiết..", 'MeewMeew');
                    const data = await getModules();
                    logger("Lấy dữ liệu thành công !", "MeewMeew");
                    console.log("================================================");
                    logger("Bắt đầu gỡ cài đặt các module..", "MeewMeew");
                    await uninstall(data);
                    logger("Gỡ cài đặt hoàn tất !", "MeewMeew");
                    console.log("================================================");
                }
                catch (e) {
                    logger("Đã có lỗi xảy ra trong quá trình uninstall module", 'error');
                }
                break;
            default:
                console.log("================================================");
                logger("==== MeewMeew ====", "MeewMeew");
                logger(`Phiên bản hiện tại: ${localVersion}`, 'MeewMeew');
                logger(`Phiên bản mới nhất: ${repoData.version}`, "MeewMeew");
                logger(`Module thay đổi: ${repoData.change.join(', ')}`, "MeewMeew");
                logger(`Sử dụng: node meewmeew --update để cập nhật module.`, "MeewMeew");
                logger(`Sử dụng: node meewmeew --install để cài đặt tất cả module.`, "MeewMeew");
                logger(`Sử dụng: node meewmeew --uninstall để gỡ cài đặt tất cả module.`, "MeewMeew");
                break;
        }
    }
    catch (e) {
        logger("Đã có lỗi xảy ra. Vui lòng thử lại.", 'MeewMeew');
    }
})();